import { ImageResponse } from "next/og";
import { extractTitle } from "core/post";
import { FontFamilies } from "@/lib/theme";
import { getPost } from "../_action";

export const runtime = "nodejs";

export const alt = "OpenGraphImage";
export const size = {
  width: 1200,
  height: 630,
};
export const contentType = "image/png";

type Props = {
  params: {
    postId: string;
  };
};

export default async function Image({ params: { postId } }: Props) {
  const { post } = await getPost({ id: postId });

  const fetchFont = fetch(
    "data:application/font-woff;base64,",
    { cache: "no-store" }
  ).then((res) => res.arrayBuffer());

  return new ImageResponse(
    (
      <div
        style={{
          position: "relative",
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          width: "100%",
          height: "100%",
          padding: "6rem",
          backgroundColor: "#fafafa",
        }}
      >
        <img
          src="data:image/svg+xml,%3C%3Fxml version='1.0' encoding='UTF-8'%3F%3E%3Csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 507.52 203.12'%3E%3Cdefs%3E%3Cstyle%3E .cls-1 %7B stroke-width: 3.12px; %7D .cls-1, .cls-2 %7B fill: none; stroke: %23000; stroke-miterlimit: 10; %7D .cls-2 %7B stroke-width: 3.12px; %7D .cls-3 %7B stroke-width: 0px; %7D %3C/style%3E%3C/defs%3E%3Cg%3E%3Cg%3E%3Cg%3E%3Cpath class='cls-3' d='m338.6,188.97l2.96,3.21c-5.43,5.68-13.33,9.38-22.96,9.38-12.84,0-21.48-4.69-24.94-18.77-4.2,11.36-14.32,18.77-33.09,18.77-20.25,0-35.56-17.28-35.56-35.06,0-44.94,66.91-36.3,66.91-55.8v-23.95c0-13.83-7.65-17.28-17.04-17.28-12.59,0-17.04,8.64-17.04,13.09,0,5.93,4.69,5.43,4.69,15.06,0,7.41-5.19,12.84-13.09,12.84s-15.31-5.93-15.31-14.07c0-20.25,21.98-31.85,42.47-31.85,29.63,0,45.93,10.12,45.93,38.52v79.51c0,9.88,1.98,11.85,6.67,11.85,3.46,0,6.91-2.96,9.38-5.43Zm-46.67-22.96v-44.94c-10.62,7.9-35.06,8.89-35.06,44.94,0,19.01,3.95,27.65,17.28,27.65,11.11,0,17.78-15.06,17.78-27.65Z'/%3E%3Cpath class='cls-3' d='m396.44,193.17h15.56v4.69h-61.73v-4.69h15.8V6.25h-15.56V1.56h45.93v191.61Z'/%3E%3Cpath class='cls-3' d='m504.06,180.57l3.46,3.21c-9.14,12.84-22.72,17.78-32.35,17.78-20.99,0-34.07-8.64-34.07-32.84v-95.8h-17.78v-4.69h17.78v-17.04c14.07-1.73,25.43-9.88,25.43-21.73h5.19v38.77h32.35v4.69h-32.35v105.19c0,11.11,4.94,15.8,12.1,15.8,5.93,0,14.57-5.19,20.25-13.33Z'/%3E%3C/g%3E%3Cg%3E%3Cpath class='cls-3' d='m175.4,51.88c0,49.31-49.81,56.86-89.56,55.85v89.06h22.89v4.78H27.73v-4.78h23.14V6.34h-23.14V1.56h66.67c39.75,0,81.01,6.79,81.01,50.31Zm-39.25,1.76c0-38.99-15.35-47.3-41.76-47.3h-8.55v96.6c32.45,0,50.31-5.53,50.31-49.31Z'/%3E%3Crect class='cls-2' x='20.31' y='1.56' width='162.5' height='200'/%3E%3Crect class='cls-1' x='1.56' y='1.56' width='200' height='200'/%3E%3C/g%3E%3C/g%3E%3C/g%3E%3C/svg%3E"
          alt="Palt"
          style={{
            position: "absolute",
            bottom: "6rem",
            right: "6rem",
            height: "3rem",
          }}
        />

        <h1
          style={{
            fontSize: "4rem",
            fontWeight: "700",
            lineHeight: "2",
            fontFamily: FontFamilies.sans,
          }}
        >
          {post ? extractTitle(post) : "NotFound"}
        </h1>

        <p
          style={{
            fontSize: "2rem",
            fontFamily: FontFamilies.sans,
            fontWeight: "700",
            lineHeight: "2",
          }}
        >
          by {post ? post.user.profile?.displayName || post.user.customId : ""}
        </p>
      </div>
    ),
    {
      ...size,
      fonts: [
        {
          name: "Tazugane",
          data: await fetchFont,
          style: "normal",
          weight: 700,
        },
      ],
    }
  );
}
